#define _CRT_SECURE_NO_WARNINGS

#include <iostream>
#include <stdio.h>
#include <string>
#include <vector>
#include <ctype.h>
#include <algorithm>

using namespace std;

struct MyStruct {
	string mWord;
	int length;
	int position;
	MyStruct(string word, int len, int pos) {
		mWord = word;
		length = len;
		position = pos;
	}

	bool operator < (const MyStruct &d) const {
		if (length == d.length) {
			return position < d.position;
		}
		else {
			return length < d.length;
		}
	}
};

class Solution {
public:
	string arrangeWords(string text) {
		vector<MyStruct> vc;
		string currentWord;
		int position = -1;
		for (int i = 0; i < text.length(); i++) {
			if (text[i] == ' ' && !currentWord.empty()) {
				MyStruct data = MyStruct(currentWord, currentWord.length(), position);
				vc.push_back(data);
				position = -1;
				currentWord.clear();
			}
			else {
				if (currentWord == "") {
					position = i;
				}
				currentWord += tolower(text[i]);
			}
			if (i == text.length() - 1) {
				MyStruct data = MyStruct(currentWord, currentWord.length(), position);
				vc.push_back(data);
				position = -1;
				currentWord.clear();
			}
		}

		sort(vc.begin(), vc.end());
		string result = "";
		for (int i = 0; i < vc.size(); i++) {
			result += vc[i].mWord;
			if (i != vc.size() - 1) {
				result += " ";
			}
		}
		result[0] = toupper(result[0]);
		return result;
	}
};

